const toggles = (state = {
    signin: true,
    signup: true
}, action) => {
    switch (action.type) {
        case 'TOGGLE_SIGNIN_BUTTON':
            return { signin: !state.signin, ...state }
        case 'SIGNED_IN':
            return { signin: true, ...state }
        default:
            return state
    }
}

export default toggles
